import React from "react";

function MovieCategories() {
  return (
    <div>
      <h2>カテゴリ別映画一覧</h2>
      <ul>
        <li>公開予定</li>
        <li>上映中</li>
        <li>話題の映画</li>
        <li>評価の高い映画</li>
      </ul>
    </div>
  );
}

export default MovieCategories;
